  }


  return(
    <div className='popupContainer'>
    <div className='popUp'>
    <CreateAccountForm sendCreateAccount={sendCreateAccount} />
    <Button onClick={props.closePopup}className='cancelPopup' variant='danger'>Cancel</Button>
    </div>

    <Alert variant={this.props.message.head === "Success" ? 'success' : 'danger'} className='loginAlert'>
    <Alert.Heading>{this.props.message.head}</Alert.Heading>
    <p>{this.props.message.body}</p>
    </Alert>
     : null}

    </div>
  )
}

export default Pupup
